    false,nt"url": null,nt"notes": "During the 1991 breeding season, three
    addled peregrine falcon (Falco peregrinus) eggs were collected from two sites in
    Vermont (Figure 1). At one site (Deer Leap), the breeding pair renested after abandoning
    their first clutch of eggs. At the second site (Bird Mtn.), a single egg was recovered
    after the pair failed to produce any offspring (Gaine and Rimmer 1992). The objective
    of this study was to determine if there was a contaminant basis for the failure
    of these three eggs.",nt"license_title": "License Not Specified",nt"extras":
